description:
When skeptical tabloid reporter Harlan James (Chase Carter) is given the assignment of investigating a string of encounters involving Bigfoot (portrayed by D.T. Carney, Dead Things), he sets out on an extraordinary adventure. After talking to a few witnesses, Harlan soon learns that Bigfoot isn't a scary monster but rather a beer-drinking, panty-stealing party animal! ...But Harlan isn't the only one trying to track down the world's most elusive creature.... 

